). Beidh Cinniúint Cluiche an Náisiúin deis a thabhairt duit a ghabháil leis an cathair agus iontais an domhain a thógáil. Beidh I Knight Cinniúint cluiche Aois an Náisiúin a bheith ar an deis de sibhialtacht. Beidh aon líon na n-imreoirí chumasadh agus beidh siad in ann a imirt faoi an comhartha céanna agus bratach. Beidh an bhfuil i ndán di de cluiche Nation a chur ar fáil go héasca a thógáil coilíneachtaí acmhainní dobyvachi in áiteanna iargúlta. Agus beidh tú a chur i láthair le cineálacha ú
